import React from "react"
//import Matter from "matter-js"

class Scene extends React.Component {

  returnStyle(){
    return {
      display: this.props.display ? "block" : "none",
      top:        50,
      height:     'calc(100% - 50px)',
      background: 'red',
      width:      '100vw',
      position:   'fixed'
    }  
  }

  render(){
    return (
      <div style={this.returnStyle()}>
  
      </div>   
    )  
  }
}

export default Scene;
